import React,{useState} from "react";
import Select from "react-select";

function MonthData () {
    var MonthList = [
    {
        "appName": "January 2022",
        label: "Jan 2022",
        "path": "/Jan22"
    },
    {
        "appName": "Febrary 2022",
        label: "Feb 2022",
        "path": "/Feb22"
    }
    ];
    
    const [result, monthvalue] = useState(MonthList.path);
    const monthHandler = e =>
    {
        monthvalue(e.path);
        }
    return (
        <div>
            <Select options={MonthList} />
            <center>
                <h1>{result} onChange={monthHandler}</h1>
            </center>
        </div>
    )
}



export default MonthData;
